    function Power(base, exponent)
    {
        if(exponent == 0)return 1
        var res = 1
        var curr = base
        var agin = exponent>0?1:-1
        exponent = Math.abs(exponent)
        while(exponent!=0){
            if((exponent&1)==1)
                res*=curr
            curr*=curr
            exponent>>=1
        }
        return agin>0?res:(1/res)
    }
